const esc = t => t.replace(/[&<>"']/g, c => "&#" + c.charCodeAt(0) + ";");
function render(f = "") {
    const q = f.toLowerCase();
    const grid = document.getElementById("grid");
    grid.innerHTML = "";
    const res = data.filter(i => 
        !q || 
        i.pseudo.toLowerCase().includes(q) || 
        i.clan.toLowerCase().includes(q) || 
        i.discord.includes(q) ||
        i.comptes.some(c => c.pseudo.toLowerCase().includes(q))
    );
    if (!res.length) {
        grid.innerHTML = "<p style='grid-column:1/-1;text-align:center;color:#888'>Aucun résultat</p>";
        return;
    }
    res.forEach(i => {
        const comptesHtml = i.comptes.map(c => 
            c.uuid 
                ? `<div style="margin:6px 0"><strong>${esc(c.pseudo)}</strong> → <a href="${c.laby_link}" target="_blank">${esc(c.uuid)}</a></div>`
                : `<div style="margin:6px 0">${esc(c.pseudo)}</div>`
        ).join("");
        grid.innerHTML += `<div class="card">
            <div class="pseudo">${esc(i.pseudo)}</div>
            <div class="info"><span class="clan">Clan :</span> ${esc(i.clan)}</div>
            <div class="info"><span class="discord">Discord :</span> ${i.discord !== "Non lié" ? `<a href="${i.discord_link}" target="_blank">${esc(i.discord)}</a>` : "Non lié"}</div>
            <div class="comptes">${comptesHtml || "<em>Aucun compte</em>"}</div>
        </div>`;
    });
}
document.getElementById("search").addEventListener("input", e => render(e.target.value.toLowerCase()));
render();
</script>
